// src/components/Navbar.js
import React from 'react';

const Navbar = () => {
  return (
    <nav style={{ backgroundColor: '#eee', padding: '10px' }}>
      <h2>My Website Navbar</h2>
    </nav>
  );
};

export default Navbar;
